  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'Intro',
	title: 'Fish Classification',
	sidebar_label: 'Introduction'
};
export const metadata = {
  "unversionedId": "classification/fish/Intro",
  "id": "classification/fish/Intro",
  "isDocsHomePage": false,
  "title": "Fish Classification",
  "description": "In this project, the aim of is develop a demo of scientific  and intelligent tools to aid the CFIA agents with their job in detecting and correctly identifying species of fish being sold.",
  "source": "@site/docs/classification/fish/Intro.md",
  "permalink": "/docs/classification/fish/Intro",
  "editUrl": "https://github.com/facebook/docusaurus/edit/master/website/docs/classification/fish/Intro.md",
  "sidebar_label": "Introduction",
  "sidebar": "classification",
  "next": {
    "title": "Instructions",
    "permalink": "/docs/classification/fish/instructions"
  }
};
  /* @jsx mdx */

export const rightToc = [{
  value: 'Introduction',
  id: 'introduction',
  children: []
}, {
  value: 'Models',
  id: 'models',
  children: []
}, {
  value: 'Training code',
  id: 'training-code',
  children: []
}, {
  value: 'Deployment Code',
  id: 'deployment-code',
  children: []
}, {
  value: 'Dateset and analysis',
  id: 'dateset-and-analysis',
  children: []
}];

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`In this project, the aim of is develop a demo of scientific  and intelligent tools to aid the CFIA agents with their job in detecting and correctly identifying species of fish being sold.`}</p>
    <h3 {...{
      "id": "introduction"
    }}>{`Introduction`}</h3>
    <p>{`In this project we made use of deep learning and neural networks to identify and classify  images of interest.`}</p>
    <h4 {...{
      "id": "data"
    }}>{`Data`}</h4>
    <p>{`For this project we scraped the web for pictures of 16 fish species. We made use of Bing  search engine APIs for downloading the images.
As one can expect, the images had to be pruned and a lot of the images had to be eliminated due to irrelevance or poor quality.
The resulting dataset contains pictures of of 16 fish species with approximately 50~60 images per class on average.
The currently supported species are:`}</p>
    <ul>
      <li parentName="ul">{`Haddock`}</li>
      <li parentName="ul">{`Hake`}</li>
      <li parentName="ul">{`Halibut`}</li>
      <li parentName="ul">{`Mackerel`}</li>
      <li parentName="ul">{`Monkfish`}</li>
      <li parentName="ul">{`Ocean Perch`}</li>
      <li parentName="ul">{`Salmon`}</li>
      <li parentName="ul">{`Sea Bass`}</li>
      <li parentName="ul">{`Snapper`}</li>
      <li parentName="ul">{`Swordfish`}</li>
      <li parentName="ul">{`Tilapia`}</li>
      <li parentName="ul">{`Trout`}</li>
      <li parentName="ul">{`Tuna`}</li>
      <li parentName="ul">{`Turbot`}</li>
      <li parentName="ul">{`Flathead `}</li>
      <li parentName="ul">{`Tarwhin`}</li>
    </ul>
    <h3 {...{
      "id": "models"
    }}>{`Models`}</h3>
    <p>{`In this project we made use of Convolutional Neural Networks(CNNs) and transfer learning.
A common way to approach this problem would be download large models trained previously on huge datasets, and fine-tune the model on our custom dataset for the best results.`}</p>
    <p>{`Several models were tried and benchmarked such as:`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://arxiv.org/abs/1608.06993"
        }}>{`DenseNet`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://arxiv.org/abs/1602.07360"
        }}>{`AlexnNet`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://neurohive.io/en/popular-networks/vgg16/"
        }}>{`VGG`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://arxiv.org/abs/1512.03385"
        }}>{`Resnet`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://arxiv.org/pdf/1409.4842.pdf"
        }}>{`Inception`}</a></li>
    </ul>
    <p>{`However the model that best performed and was chosen was DenseNet with an accuracy of `}<strong parentName="p">{`75%`}</strong>{`. `}</p>
    <h3 {...{
      "id": "training-code"
    }}>{`Training code`}</h3>
    <p>{`For loading and training our model we made use of `}<a parentName="p" {...{
        "href": "https://pytorch.org/"
      }}>{`PyTorch`}</a>{` and `}<a parentName="p" {...{
        "href": "https://pytorch.org/docs/stable/torchvision/index.html"
      }}>{`TorchVision`}</a>{` libraries.
They house a variety of previously tested and used architectures which can be loaded with or without pre-trained weights and can be used on custom datasets for research/deployment.`}</p>
    <h3 {...{
      "id": "deployment-code"
    }}>{`Deployment Code`}</h3>
    <p>{`We made use of the `}<a parentName="p" {...{
        "href": "https://flask.palletsprojects.com/en/1.1.x/"
      }}>{`Flask`}</a>{` library to deploy or model and host it on a server. An easy and intuitive drag and drop front-end was designed for the user.`}</p>
    <h3 {...{
      "id": "dateset-and-analysis"
    }}>{`Dateset and analysis`}</h3>
    <p>{`For each fish species, the data was randomly shuffled and a train and validation split was performed.
The dataset consists of very noisy and unclear pictures along with very well captured images.
The used dataset and was verified by experts in the aquatic domain ad therefore there are some pictures in the training set which belong to the wrong species of the fish.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
